const TitleBlue = (Alumno, matricula) => {
    //const name = 'Alfredo';
    return (
        <h1 className='Titulo1' style={{color:'blue'}}>Hello there {alumno} con id {matricula}</h1>
    );
};

const TitleRed = () => {
    const name = 'Alfredo';
    return (
        <h1 className='Titulo1' style={{color:'red'}}>Hello there {name}</h1>
    );
};

export {TitleBlue, TitleRed};
